package: github.com/giantswarm/aws-operator
import:
- package: github.com/aws/aws-sdk-go
  version: master
  subpackages:
  - service/autoscaling
  - service/s3
  - service/elb
  - service/route53
  - awserr
- package: github.com/giantswarm/microkit
  version: master
  subpackages:
  - command
  - error
  - logger
  - server
  - transaction
- package: github.com/giantswarm/operatorkit
  verson: master
- package: google.golang.org/grpc
  version: v1.2.1
- package: github.com/giantswarm/awstpr
  version: master
- package: github.com/giantswarm/k8scloudconfig
  version: master
- package: github.com/stretchr/testify
  version: v1.1.4
  subpackages:
  - assert
- package: k8s.io/client-go
  version: v3.0.0
# apimachinery is pinned to the version client-go uses.
- package: k8s.io/apimachinery
  version: 85ace5365f33b16fc735c866a12e3c765b9700f2
